export default function Footer() {
  return (
    <footer className="bg-black text-white p-4 mt-10">
      <div className="text-center">
        <p>&copy; {new Date().getFullYear()} Kafić Backstage. Sva prava zadržana.</p>
      </div>
    </footer>
  );
}
